(window.webpackJsonp=window.webpackJsonp||[]).push([[5],{427:function(a,e){a.exports={frontMatter:{slug:"fixbrand",fileName:"fixbrand",readingTime:"☕️ 1 minuto de lectura",wordCount:183,date:"21-12-2015",formattedDate:"Diciembre 2015",imageUrl:"//res.cloudinary.com/wochap/image/upload/v1495070100/works/fixbrand.png",heroImageUrl:"//res.cloudinary.com/wochap/image/upload/v1495070206/wochap/hero/fixbrand.jpg",title:"Fixbrand",tasks:"Desarrollo landing page y panel de administración",role:"Full-stack developer",siteLink:"http://fixbrand.com/",description:"Fixbrand es una agencia creativa de marcas que apuesta por el trabajo estratégico, creativo y sostenido en el tiempo.",tags:["Full-stack","Laravel","Jquery","Stylus","Gulp","Freelance"]},bodyHtml:'<h2 id=reto>Reto</h2><p>Realizar un sitio web gestionable, con animaciones entre paginas.<h2 id=solución>Solución</h2><p>Realize el panel de administracion con <a href=http://getbootstrap.com/ rel=nofollow target=_blank>Bootstrap</a> y <a href=https://laravel.com/ rel=nofollow target=_blank>Laravel</a>, y el landing page con <a href=https://jquery.com rel=nofollow target=_blank>Jquery</a>.<h3 id=tecnologías-destacadas>Tecnologías destacadas:</h3><ul><li><a href=https://css-tricks.com/snippets/css/a-guide-to-flexbox/ rel=nofollow target=_blank>CSS FlexBox</a></ul><h3 id=workflow>Workflow:</h3><ul><li><strong>PHP:</strong> <a href=https://laravel.com/ rel=nofollow target=_blank>Laravel</a>.<li><strong>HTML:</strong> <a href=https://laravel.com/docs/5.3/blade rel=nofollow target=_blank>Blade</a>.<li><strong>CSS:</strong> <a href=http://getbootstrap.com/ rel=nofollow target=_blank>Bootstrap</a>, <a href=http://stylus-lang.com/ rel=nofollow target=_blank>Stylus</a>, <a href=https://suitcss.github.io/ rel=nofollow target=_blank>SuitCSS</a>.<li><strong>JS:</strong> <a href=https://jquery.com/ rel=nofollow target=_blank>Jquery</a>.<li><strong>Build System:</strong> <a href=http://gulpjs.com/ rel=nofollow target=_blank>Gulp</a>, <a href=https://laravel.com/docs/5.3/elixir rel=nofollow target=_blank>Laravel elixir</a>.</ul><h3 id=logros>Logros:</h3><ul><li>Simular un <code>SPA</code> con <a href=https://jquery.com/ rel=nofollow target=_blank>Jquery</a>:</ul><div class=c-markdown-image-full><img alt="Portafolio del sitio web Fixbrand"src=//res.cloudinary.com/wochap/image/upload/v1495070187/wochap/body/fixbrand-spa.gif></div><ul><li>Desarrollar 3 <code>CRUD</code> (portafolio, contacto, clientes), tanto en el <code>Back-end</code> como en el <code>Front-end</code>.<li>Subir una o varias imagenes al servidor haciendo uso de <code>AJAX</code>.</ul><h2 id=experiencia>Experiencia</h2><p>Como primer proyecto remoto, quede muy satisfecho, la experiencia de trabajar en pijamas es muy confortable aunque requiere de bastante <strong>disciplina</strong>.'}}}]);
